package org.jn.core.java.student.dawood.akram.weekly.week2;

public class Compare2Nums {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
         int a = 10;
         int b = 20;
         System.out.println("a>b = "+(a>b));
         System.out.println("a>=b = "+(a>=b));
         System.out.println("a<b = "+(a<b));
         System.out.println("a<=b = "+(a<=b));
         System.out.println("a==b = "+(a==b));
         System.out.println("a!=b = "+(a!=b));

	}

}
